import React from "react"





class Navbar extends React.Component{
    render(){
        return(
                <section id="header" className="dark">
                    <header>
                        <h1><span>Technology</span>is taking over the world</h1>
                        <p>Do you want to know why? Scroll down and see for yourself
                        </p>
                    </header>
                </section>
        )
    }
}
export default Navbar
